import './App.css';
import NavBarCom from './Components/NavbarCom/NavBarCom';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBarCom />
        <Routes>
          <Route exact path="/" element={<HomeCom />} />
          <Route path="/experience" element={<ExperienceCom />} />
          <Route path="/about" element={<AboutCom />} />
          <Route path="/contact" element={<ContactCom />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
